function MovieCard({ data }) {
    // console.log(data);
    return <div className="boxCard" style={{ position: "relative" }}>
        <h3>{data.movieName}</h3>
        <CloseButton style={{
            position: "absolute", top: 10 + "px", top: -11 + "px",
            right: -13 + "px",
            border:1 + "px" + "solid" 
        }} />
    </div>
}
export default MovieCard
